import classes from "./Navbar.module.css";

const NavBar = () => {
  return (
    <div className={classes.navbar}>
      <p>
        Booking Website
        <button className={classes.button}>Register</button>
        <button className={classes.button}>Login</button>
      </p>

      <div></div>
    </div>
  );
};

export default NavBar;
